// Find the shortest palindrome that begins with a supplied string.
// Algorithm idea is simple:
// - Find the longest postfix of supplied string that is a palindrome.
// - Append to the end of the string reverse of a string prefix that comes before the palindromic suffix.
// >>> MakePalindrome('')
// ''
// >>> MakePalindrome('cat')
// 'catac'
// >>> MakePalindrome('cata')
// 'catac'
func MakePalindrome(str string) string {
	if str == "" {
		return ""
	}

	// Find the longest postfix that is a palindrome
	for i := 0; i < len(str); i++ {
		// Check if substring from i to end is a palindrome
		if IsPalindrome(str[i:]) {
			// Found palindromic suffix starting at position i
			// Need to prepend the reverse of the prefix (0 to i)
			prefix := str[:i]
			// Reverse the prefix
			runes := []rune(prefix)
			for left, right := 0, len(runes)-1; left < right; left, right = left+1, right-1 {
				runes[left], runes[right] = runes[right], runes[left]
			}
			return string(runes) + str
		}
	}

	// This shouldn't be reached if the logic is correct
	return str
}

